CREATE OR REPLACE PROCEDURE vvre_ger_ins_aut_conv_hist( nr_seq_autorizacao_p  IN  NUMBER, ds_historico_p    IN  VARCHAR2, nr_seq_estagio_p  IN  NUMBER) IS

vvre_tps_aut_conv_hist_w vvre_tps_aut_conv_hist%rowtype;

BEGIN
UPDATE autorizacao_convenio
SET nr_seq_estagio = nr_seq_estagio_p
WHERE nr_sequencia = nr_seq_autorizacao_p;

SELECT vvre_tps_aut_conv_hist_seq.NEXTVAL
INTO vvre_tps_aut_conv_hist_w.nr_sequencia
FROM dual;

vvre_tps_aut_conv_hist_w.nr_seq_autorizacao := nr_seq_autorizacao_p;
vvre_tps_aut_conv_hist_w.ds_historico  := ds_historico_p;
vvre_tps_aut_conv_hist_w.ie_tipo   := 'I';

INSERT INTO vvre_tps_aut_conv_hist VALUES vvre_tps_aut_conv_hist_w;

COMMIT;
END vvre_ger_ins_aut_conv_hist;
/

